&lt;li&gt;&lt;span class=&#34;exturl&#34; data-url=&#34;aHR0cHM6Ly9naXRodWIuY29tL01pa2VDb2Rlci9oZXhvLWJsb2ctZW5jcnlwdC9pc3N1ZXMvNjg=&#34;&gt;Issue 68&lt;/span&gt;&lt;/li&gt;
&lt;/ul&gt;
&lt;/blockquote&gt;
&lt;h2 id=&#34;这是个啥&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#这是个啥&#34;&gt;#&lt;/a&gt; 这是个啥&lt;/h2&gt;
&lt;ul&gt;
&lt;li&gt;
&lt;p&gt;&lt;s&gt;首先，这是 Hexo 生态圈中 &lt;strong&gt;最好的&lt;/strong&gt; 博客加密插件&lt;/s&gt;&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;你可能需要写一些私密的博客，通过密码验证的方式让人不能随意浏览.&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;这在 wordpress, emlog 或是其他博客系统中都很容易实现，然而 hexo 除外. 😦&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;为了解决这个问题，让我们有请 &amp;quot;hexo-blog-encrypt&amp;quot;.&lt;/p&gt;
&lt;/li&gt;
&lt;/ul&gt;
&lt;h2 id=&#34;特性&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#特性&#34;&gt;#&lt;/a&gt; 特性&lt;/h2&gt;
&lt;ul&gt;
&lt;li&gt;
&lt;p&gt;一旦你输入了正确的密码，它将会被存储在本地浏览器的 localStorage 中。按个按钮，密码将会被清空。若博客中又脚本，它将会被正确地执行.&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;支持按标签加密.&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;所有的核心功能都是由原生的 API 所提供的。在 Node.js 中，我们使用 &lt;span class=&#34;exturl&#34; data-url=&#34;aHR0cHM6Ly9ub2RlanMub3JnL2Rpc3QvbGF0ZXN0LXYxMi54L2RvY3MvYXBpL2NyeXB0by5odG1s&#34;&gt;Crypto&lt;/span&gt;. 在浏览器中，我们使用 &lt;span class=&#34;exturl&#34; data-url=&#34;aHR0cHM6Ly9kZXZlbG9wZXIubW96aWxsYS5vcmcvZW4tVVMvZG9jcy9XZWIvQVBJL1dlYl9DcnlwdG9fQVBJ&#34;&gt;Web Crypto API&lt;/span&gt;.&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;&lt;span class=&#34;exturl&#34; data-url=&#34;aHR0cHM6Ly90b29scy5pZXRmLm9yZy9odG1sL3JmYzI4OTg=&#34;&gt;PBKDF2&lt;/span&gt;, &lt;span class=&#34;exturl&#34; data-url=&#34;aHR0cHM6Ly9udmxwdWJzLm5pc3QuZ292L25pc3RwdWJzL0ZJUFMvTklTVC5GSVBTLjE4MC00LnBkZg==&#34;&gt;SHA256&lt;/span&gt; 被用于分发密钥，&lt;span class=&#34;exturl&#34; data-url=&#34;aHR0cHM6Ly9jc3JjLm5pc3QuZ292L3B1YmxpY2F0aW9ucy9kZXRhaWwvc3AvODAwLTM4YS9maW5hbA==&#34;&gt;AES256-CBC&lt;/span&gt; 被用于加解密，我们还使用 &lt;span class=&#34;exturl&#34; data-url=&#34;aHR0cHM6Ly9jc3JjLm5pc3QuZ292L2NzcmMvbWVkaWEvcHVibGljYXRpb25zL2ZpcHMvMTk4LzEvZmluYWwvZG9jdW1lbnRzL2ZpcHMtMTk4LTFfZmluYWwucGRm&#34;&gt;HMAC&lt;/span&gt; 来验证密文的来源，并确保其未被篡改.&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;我们广泛地使用 Promise 来进行异步操作，以此确保线程不被杜塞.&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;加密页面多主题支持，现在已经支持的主题有 [ &lt;code&gt;default&lt;/code&gt; ,  &lt;code&gt;xray&lt;/code&gt; ], 更多的主题正在开发中.&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;过时的浏览器将不能正常显示，因此，请升级您的浏览器.&lt;/p&gt;
&lt;/li&gt;
&lt;/ul&gt;
&lt;h2 id=&#34;在线演示&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#在线演示&#34;&gt;#&lt;/a&gt; 在线演示&lt;/h2&gt;
&lt;ul&gt;
&lt;li&gt;点击 &lt;span class=&#34;exturl&#34; data-url=&#34;aHR0cHM6Ly9taGV4by5naXRodWIuaW8v&#34;&gt;Demo Page&lt;/span&gt;, &lt;strong&gt;所有的密码都是  &lt;code&gt;hello&lt;/code&gt; &lt;/strong&gt;.&lt;/li&gt;
&lt;/ul&gt;
&lt;h2 id=&#34;安装&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#安装&#34;&gt;#&lt;/a&gt; 安装&lt;/h2&gt;
&lt;ul&gt;
&lt;li&gt;
&lt;p&gt;&lt;code&gt;npm install --save hexo-blog-encrypt&lt;/code&gt;&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;或  &lt;code&gt;yarn add hexo-blog-encrypt&lt;/code&gt;  (需要) &lt;span class=&#34;exturl&#34; data-url=&#34;aHR0cHM6Ly95YXJucGtnLmNvbS9lbi8=&#34;&gt;Yarn&lt;/span&gt;)&lt;/p&gt;
&lt;/li&gt;
&lt;/ul&gt;
&lt;h2 id=&#34;快速使用&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#快速使用&#34;&gt;#&lt;/a&gt; 快速使用&lt;/h2&gt;
&lt;ul&gt;
&lt;li&gt;将 &amp;quot;password&amp;quot; 字段添加到您文章信息头就像这样.&lt;/li&gt;
