&lt;h3 id=&#34;禁用-log&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#禁用-log&#34;&gt;#&lt;/a&gt; 禁用 Log&lt;/h3&gt;
&lt;p&gt;If you want to disable the logging, you can add a silent property in  &lt;code&gt;_config.yml&lt;/code&gt;  and set it to true.&lt;br /&gt;
 如果你想要禁止使用 Log, 你可以在  &lt;code&gt;_config.yml&lt;/code&gt;  中增加一个 silent 属性，并将其设置为 true.&lt;/p&gt;
